import React from 'react';

import '../style/app.scss'

export class Roulette extends React.Component {


  render(){
      return(
      <div className ="subtitles">
            <div id="triangle">
            </div>
            <p id="skills"> SKILLS </p>
            <p id="education"> EDUCATION </p>
            <p id="experiences"> EXPERIENCES </p>
            <p id="volunteering"> VOLUNTEERING </p>
            <p id="interests"> INTERESTS </p>
            <p id="softskills"> SOFT SKILLS </p>

      </div>
)
  }

}

export default Roulette;
